import React, { useEffect, useState } from 'react';
import fetch_token from './fetch_token.js';
import fetch_calendar from './calendar.js';

function App() {
    const username = "1wadadwa5219";
    const [calendarData, setCalendarData] = useState([]); 
    const [token, setToken] = useState(localStorage.getItem('access_token'));
    const [message, setMessage] = useState(localStorage.getItem('msg'));
    const [isFetchingToken, setIsFetchingToken] = useState(false); // 添加状态控制

    useEffect(() => {
        const fetchData = async () => {
            if (!isFetchingToken) {
                setIsFetchingToken(true);
                await fetch_token(username, "울산");
                setToken(localStorage.getItem('access_token'));
                setMessage(localStorage.getItem('msg'));
                setIsFetchingToken(false);
            }
        };
        fetchData();
    }, [username, isFetchingToken]); // 在依赖数组中添加 isFetchingToken

    useEffect(() => {
        const fetchData = async () => {
            if (token) {
                try {
                    const data = await fetch_calendar(token);
                    setCalendarData(data);
                } catch (error) {
                    console.error("Error fetching calendar data:", error);
                }
            }
        };
        fetchData();
    }, [token]);

    return (
        <div>
            <h3>Information</h3>
            <p>Token: {token || "No token available"}</p>
            <p>Message: {message || "No message available"}</p>

            <h3>Past Events</h3>
            <ul>
                {Array.isArray(calendarData) && calendarData.map(event => (
                    <li key={event.id}>
                        {event.title} - {event.date}
                    </li>
                ))}
                {!Array.isArray(calendarData) && <li>No events found.</li>}
            </ul>
        </div>
    );
}

export default App;
